          "description": "\u003cp\u003eAssuming \u003ccode\u003exs\u003c/code\u003e is a sequence containing the elements of a square matrix,\n   \u003ccode\u003e\u003ccode\u003e\u003ca\u003ecropSquare\u003c/a\u003e\u003c/code\u003e n xs\u003c/code\u003e returns the elements of the submatrix of size \u003ccode\u003en\u003c/code\u003ex\u003ccode\u003en\u003c/code\u003e,\n   centred within the original matrix \u003ccode\u003exs\u003c/code\u003e.\n\u003c/p\u003e\u003cp\u003eExample: Suppose we have a \u003cem\u003e5\u003c/em\u003ex\u003cem\u003e5\u003c/em\u003e matrix and we want to extract the\n   central \u003cem\u003e3\u003c/em\u003ex\u003cem\u003e3\u003c/em\u003e submatrix, as illustrated below.\n\u003c/p\u003e\u003cpre\u003e a b c d e\n f g h i j            g h i\n k l m n o    ---\u003e    l m n\n p q r s t            q r s\n u v w x y\n\u003c/pre\u003e\u003cp\u003eWe can represent the elements of the original matrix as \u003ccode\u003e['a'..'y']\u003c/code\u003e.\n   The elements of the submatrix are\n   \u003ccode\u003e['g', 'h', 'i', 'l', 'm', 'n', 'q', 'r', 's']\u003c/code\u003e,\n   or equivalently, \u003ccode\u003e\"ghilmnqrs\"\u003c/code\u003e. And that is what\n   \u003ccode\u003e\u003ccode\u003e\u003ca\u003ecropSquare\u003c/a\u003e\u003c/code\u003e 3 ['a'..'y']\u003c/code\u003e returns.\n\u003c/p\u003e",
